/* solver:(x0[62],p[44],lbx[62],ubx[62],lbg[82],ubg[82],lam_x0[62],lam_g0[82])->(x[62],f,g[82],lam_x[62],lam_g[82],lam_p[44]) */
static int casadi_f1(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  const casadi_real one=1;
  struct casadi_ipopt_data* d=&casadi_f1_mem[mem];
  struct casadi_ipopt_prob p;
  struct casadi_nlpsol_data d_nlp;
  struct casadi_nlpsol_prob p_nlp;
  struct casadi_oracle_data d_oracle;
  d_nlp.oracle = &d_oracle;
  d_nlp.p = arg[1];
  d_nlp.lbx = arg[2];
  d_nlp.ubx = arg[3];
  d_nlp.lbg = arg[4];
  d_nlp.ubg = arg[5];
  d_nlp.x0 = arg[0];
  d_nlp.lam_x0 = arg[6];
  d_nlp.lam_g0 = arg[7];
  d_nlp.x = res[0];
  d_nlp.f = res[1];
  d_nlp.g = res[2];
  d_nlp.lam_x = res[3];
  d_nlp.lam_g = res[4];
  d_nlp.lam_p = res[5];
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 62;
  p_nlp.ng = 82;
  p_nlp.np = 44;
  p_nlp.detect_bounds.ng = 0;
  casadi_nlpsol_init(&d_nlp, &arg, &res, &iw, &w);
  if (d_nlp.x0) {
    casadi_copy(d_nlp.x0, 62, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 62);
  }
  if (d_nlp.lbx) {
    casadi_copy(d_nlp.lbx, 62, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 62, -casadi_inf);
  }
  if (d_nlp.ubx) {
    casadi_copy(d_nlp.ubx, 62, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 62, casadi_inf);
  }
  if (d_nlp.lam_x0) {
    casadi_copy(d_nlp.lam_x0, 62, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 62);
  }
  if (d_nlp.lbg) {
    casadi_copy(d_nlp.lbg, 82, d_nlp.lbz+62);
  } else {
    casadi_fill(d_nlp.lbz+62, 82, -casadi_inf);
  }
  if (d_nlp.ubg) {
    casadi_copy(d_nlp.ubg, 82, d_nlp.ubz+62);
  } else {
    casadi_fill(d_nlp.ubz+62, 82, casadi_inf);
  }
  if (d_nlp.lam_g0) {
    casadi_copy(d_nlp.lam_g0, 82, d_nlp.lam+62);
  } else {
    casadi_clear(d_nlp.lam+62, 82);
  }
  d->nlp = &d_nlp;
  d->prob = &p;
  p.nlp = &p_nlp;
  p.sp_a = casadi_s10;
  p.sp_h = casadi_s18;
  casadi_ipopt_setup(&p);
  p.eval_f = casadi_nlp_f0;
  p.eval_g = casadi_nlp_g0;
  p.eval_grad_f = casadi_nlp_grad_f0;
  p.eval_jac_g = casadi_nlp_jac_g0;
  p.eval_h = casadi_nlp_hess_l0;
  casadi_ipopt_init(d, &arg, &res, &iw, &w);
  casadi_ipopt_presolve(d);
  AddIpoptIntOption(d->ipopt, "print_level",0);
  AddIpoptStrOption(d->ipopt, "sb","yes");
  AddIpoptStrOption(d->ipopt, "linear_solver","mumps");
  casadi_ipopt_solve(d);
  d->arg[0] = d_nlp.z;
  d->arg[1] = d_nlp.p;
  d->arg[2] = &one;
  d->arg[3] = d_nlp.lam+62;
  d->res[0] = 0;
  d->res[1] = 0;
  d->res[2] = 0;
  d->res[3] = d_nlp.lam_p;
  if (casadi_f2(d->arg, d->res, d->iw, d->w, 0)) return 1;
  casadi_scal(44, -1.0, d_nlp.lam_p);
  casadi_copy(d_nlp.z, 62, d_nlp.x);
  casadi_copy(d_nlp.z + 62, 82, d_nlp.g);
  casadi_copy(d_nlp.lam, 62, d_nlp.lam_x);
  casadi_copy(d_nlp.lam + 62, 82, d_nlp.lam_g);
  if (d_nlp.f) casadi_copy(&d_nlp.objective, 1, d_nlp.f);
  if (d_nlp.lam_p) casadi_copy(d_nlp.lam_p, 44, d_nlp.lam_p);
  return 0;
  return 0;
}

int casadi_f1_alloc_mem(void) {
  return casadi_f1_mem_counter++;
}

int casadi_f1_init_mem(int mem) {
  ipopt_init_mem(&casadi_f1_mem[mem]);
  return 0;
}

void casadi_f1_free_mem(int mem) {
  ipopt_free_mem(&casadi_f1_mem[mem]);
}

int casadi_f1_checkout(void) {
  int mid;
  if (casadi_f1_unused_stack_counter>=0) {
    return casadi_f1_unused_stack[casadi_f1_unused_stack_counter--];
  } else {
    if (casadi_f1_mem_counter==CASADI_MAX_NUM_THREADS) return -1;
    mid = casadi_f1_alloc_mem();
    if (mid<0) return -1;
    if(casadi_f1_init_mem(mid)) return -1;
    return mid;
  }
}

void casadi_f1_release(int mem) {
  casadi_f1_unused_stack[++casadi_f1_unused_stack_counter] = mem;
}

